const e={greeting:{0:{zh_cn:"船长，早上好。",en:"Captain, good morning.",ru:"Капитан, доброе утро."},1:{zh_cn:"呜噜喵~",en:"Uru nya~",ru:"Уру ня~"},2:{zh_cn:"船长，你去过猫猫界吗？",en:"Captain, have you been to the Neco-world?",ru:"Капитан, вы были в Неко-мире?"},3:{zh_cn:"猫猫为您服务，船长。",en:"Captain, neco will serve you.",ru:"Капитан, неко будет вам служить."},4:{zh_cn:"想喝红茶吗，船长？",en:"Captain, would you like some red tea?",ru:"Капитан, хотите красное чайное?"}},general:{0:{zh_cn:"哎呀，真是惨烈喵！",en:"Ouch, it was a critical hit nya!",ru:"Ой, это был критический удар ня!"},1:{zh_cn:"有点不忍心看到这种场面喵~",en:"This scene is kind of rough nya ~",ru:"Этот сценарий немножко ужасный ня~"},2:{zh_cn:"猫猫界没有这种武器喵。",en:"There is no such weapon in the Neco-world nya.",ru:"В Неко-мире нет такого оружия ня."},3:{zh_cn:"人类最终迎来幻想的黎明~",en:"Humankind finally reached the dawn of illusion~",ru:"Человечества закончились войной с иллюзией~"},4:{zh_cn:"节日上的烟花喵~",en:"Fireworks on celebration nya~",ru:"Фейерверки на празднике ня~"},5:{zh_cn:"船长，还是尽量向收益高的地方发射吧。",en:"Captain, let's try to launch towards the areas with the most profit.",ru:"Капитан, давайте стараться запускать в направлении районов с наибольшей выгодой."},6:{zh_cn:"哎呀，感觉又浪费了喵~",en:"Oh no, wasted nya~",ru:"Ой, это потрачено зря ня~"}},Russia:{0:{zh_cn:"船长，那个地方是你的家乡吧？",en:"Captain, is this place your homeland?",ru:"Капитан, это ваша домашняя?"},1:{zh_cn:"猫猫界里也有雪之国度喵。",en:"In the Neco-Wold, there is also a country of snow nya.",ru:"В Неко-мире есть страна с снегом ня."},2:{zh_cn:"那种地方，可伤不了多少人喵~",en:"In this place, it can't hurt a lot of people nya~",ru:"В этом месте, он не может повредить много людей ня~"}},Ukraine:{0:{zh_cn:"还想再看一看向日葵喵。",en:"I want to see sunflowers again nya.",ru:"Я хочу снова увидеть подсолнухи, ня."}},"United States":{0:{zh_cn:"听说武器之神就生活在那里喵~",en:"I heard that the God of Weapons lives there nya~",ru:"Я слышал, что Бог оружия живет там ня~"},1:{zh_cn:"地图上为什么会有两个美国？",en:"Why are there two United States on the map?",ru:"Почему на карте есть два Соединенные Штаты?"}},China:{0:{zh_cn:"呵呵，猫猫界里有很多那里的餐厅喵。",en:"In the Neco-world, there are many restaurants from that place nya.",ru:"В Неко-мире есть много ресторанов из этого места ня."},1:{zh_cn:"像蜉蝣一样~",en:"Like a mayfly~",ru:"Как подёнка~"}},Japan:{0:{zh_cn:"猫猫界的入口就在那个地方喵。",en:"The entrance to the Neco-world is in that place nya.",ru:"Вход в Неко-мире находится там ня."},1:{zh_cn:"樱花，令人怀念喵~",en:"Cherry blossoms are so nostalgic nya~",ru:"Цветущая вишня вызывает такую ностальгию, ня~"}},Korea:{0:{zh_cn:"好久没听流行音乐了喵。",en:"It's been a while since I last listened to pop music nya.",ru:"Давненько я в последний раз не слушал поп-музыку ня."}},"United Kingdom":{0:{zh_cn:"离群索居~",en:"Solitary~",ru:"Одинокий~"},1:{zh_cn:"噗噗噗，猫猫界里也有龙阳之辈。",en:"Hehe, there are also special lovers in the Neco-world.",ru:"Хехе, в Неко-мире тоже есть и особые любовники."}},France:{0:{zh_cn:"会掀起革命吗？",en:"Will they start a revolution?",ru:"Они начнут революцию?"},1:{zh_cn:"激起层层的胭脂浪~",en:"It stirred up layers of rouge waves~",ru:"Поднял волну за волной румяной~"}},Australia:{0:{zh_cn:"蜘蛛很可怕喵~",en:"Spiders are very scary nya~",ru:"Пауки очень страшные ня~"},1:{zh_cn:"袋子里装的都是什么呢~",en:"What's in the pocket~",ru:"Что в кармане~"}},Canada:{0:{zh_cn:"空荡荡的喵~",en:"Deserted nya~",ru:"Заброшенный ня~"}},Greenland:{0:{zh_cn:"虚无~",en:"Void~",ru:"Пустота~"}},Venezuela:{0:{zh_cn:"最终，王者踏上了梦想的道路。",en:"In the end, the king embarked on the road of dream.",ru:"В конце концов, король отправился на путь мечты."}}},n={greeting:{0:{zh_cn:"可以摸摸我吗，船长？",en:"Can you pet me, Captain?",ru:"Можете погладить меня, Капитан?"},1:{zh_cn:"我今天感觉很可爱~",en:"I'm feeling cute today~",ru:"Я чувствую себя мило сегодня~"},2:{zh_cn:"喵~喵喵~",en:"Nya~ nya nya~",ru:"Ня~ ня ня~"},3:{zh_cn:"船长，我想吃草莓。",en:"Captain, I want to eat strawberries.",ru:"Капитан, я хочу съесть клубнику."},4:{zh_cn:"抱抱~",en:"Hug~",ru:"Обнимаю~~"}},general:{0:{zh_cn:"美丽的世界~",en:"Such a beautiful world~",ru:"Великолепный мир~"},1:{zh_cn:"可以帮我梳毛吗？船长~",en:"May you help me comb my hair, Captain?",ru:"Капитан, вы можете помочь мне причесаться?"},2:{zh_cn:"感觉好寂寞啊~",en:"Feel a little lonely~",ru:"Почувствуй себя немного одиноким~"},3:{zh_cn:"之后就只有我和船长了~",en:"There are only me and Captain left~",ru:"Остались только я и Капитан~"},4:{zh_cn:"我们来创造伊甸园吧~",en:"Let's create Eden together~",ru:"Давайте создадим Эден~"},5:{zh_cn:"不要总是向草丛发射嘛~",en:"Don't always launch towards the bushes~",ru:"Не стреляйте всегда в кусты~"},6:{zh_cn:"我觉得那边的建筑比较不错~",en:"I think the buildings over there are quite nice~",ru:"Я считаю, что здания там довольно хорошие~"}},Russia:{0:{zh_cn:"想和船长在那个地方种植鲜花。",en:"I want to plant flowers in that place with Captain.",ru:"Я хочу посадить цветы в этом месте с Капитаном."},1:{zh_cn:"还是船长更温暖一些~",en:"Captain is more warm than that.",ru:"Капитан больше теплее чем это."},2:{zh_cn:"想和船长去那里旅游。",en:"I want to visit that place with Captain.",ru:"Я хочу посетить этот место с Капитаном."}},Ukraine:{0:{zh_cn:"那里的鲜花好茂盛。",en:"The flowers are so lush there.",ru:"Цветы в этом месте очень красивы."}},"United States":{0:{zh_cn:"缅因猫，很可爱呢~",en:"Maine Coon cats are so cute~",ru:"Кошки мейн-куны такие милые~"},1:{zh_cn:"船长，你去过那里吗？",en:"Captain, have you visited that place before?",ru:"Капитан, вы были в этом месте раньше?"}},China:{0:{zh_cn:"那里都有什么动物啊？",en:"What are kinds of animals living in that place?",ru:"Какие животные обитают в этом месте?"},1:{zh_cn:"船长，你害怕老鼠吗？",en:"Captain, are you afraid of rats?",ru:"Капитан, вы боитесь крыс?"}},Japan:{0:{zh_cn:"船长，一起去吃美味吧~",en:"Captain, let's eat delicious together~",ru:"Капитан, давайте вместе вкусно покушаем~"},1:{zh_cn:"你听说过“Uni”吗，船长？",en:"Have you heard of Uni before, Captain?",ru:"Вы раньше слышали об Уни, Капитан?"}},Korea:{0:{zh_cn:"时尚猫猫~",en:"Fashion kitties~",ru:"Модные котята~"}},"United Kingdom":{0:{zh_cn:"我只喜欢……船长哦~",en:"Captain... my only love~",ru:"Капитан... моя единственная любовь~"},1:{zh_cn:"伦敦桥要倒下咯~",en:"London bridge is falling down~",ru:"Лондонский мост рушится~"}},France:{0:{zh_cn:"船长，你会画油画吗？",en:"Captain, can you paint oil paintings?",ru:"Капитан, вы умеете писать картины маслом?"},1:{zh_cn:"硝烟的味道。",en:"The smell of gunpowder.",ru:"Запах пороха."}},Australia:{0:{zh_cn:"都灭绝了呢~",en:"All extinct~",ru:"Все вымерли~"},1:{zh_cn:"想和船长一起……被流放到那里。",en:"I want to be exiled there... with Captain.",ru:"Я хочу быть изгнан туда... с Капитаном."}},Canada:{0:{zh_cn:"呼噜~",en:"Purr~",ru:"Мур~"}},Venezuela:{0:{zh_cn:"独特的地方。",en:"Special place.",ru:"Особый место."}}},a={greeting:{0:{zh_cn:"船长，想喝咖啡吗？",en:"Captain, would you like a coffee?",ru:"Капитан, хотите кофе?"},1:{zh_cn:"今天是个晴天呢。",en:"Today is a sunny day.",ru:"Сегодня солнечно."},2:{zh_cn:"好想下雨啊……",en:"I really want to rain...",ru:"Я хочу дождь..."},3:{zh_cn:"想洗澡吗，船长？",en:"Wanna take a shower, Captain?",ru:"Хочешь принять душ, Капитан?"},4:{zh_cn:"哗啦啦~哗啦啦~",en:"Splash~ splash~",ru:"Водопад~ водопад~"}},general:{0:{zh_cn:"大海比陆地好。",en:"Sea is better than land.",ru:"Море лучше чем земля."},1:{zh_cn:"下回可以在海上引爆吗？",en:"Can we detonate on the sea next time?",ru:"Можем ли мы взорвать на море?"},2:{zh_cn:"氢能带来好多水。",en:"Hydrogen can bring a lot of water.",ru:"Водород может принести много воды."},3:{zh_cn:"海底会不会有一个大型避难所？",en:"Will there be a huge refuge under the sea?",ru:"Будет ли огромное убежище под водой?"},4:{zh_cn:"我能为船长降温哦。",en:"I can make you feel cooler, Captain.",ru:"Я могу уменьшить температуру, Капитан."},5:{zh_cn:"感觉好浪费水啊……",en:"Such a waste of water...",ru:"Такая трата воды..."},6:{zh_cn:"请不要往河里发射啊……",en:"Please don't launch towards the river...",ru:"Не запускайте всегда в реку..."}},Russia:{0:{zh_cn:"水会冻住的吧？",en:"Water will freeze.",ru:"Вода будет замерзать."},1:{zh_cn:"我可以做雪糕，船长。",en:"I can make ice-cream, Captain.",ru:"Я умею делать мороженое, Капитан."},2:{zh_cn:"看起来没有任何留念呢。",en:"It seems like... doesn't have any nostalgia.",ru:"Вроде... нет никакой ностальгии."}},Ukraine:{0:{zh_cn:"黑色的土地。",en:"Rich soil.",ru:"богатая почва."}},"United States":{0:{zh_cn:"想在密西西比游泳。",en:"Want to swim in Mississippi.",ru:"Хочу искупаться в Миссисипи."},1:{zh_cn:"哪个海岸更好呢~",en:"Which coast is better?",ru:"Какое побережье лучше?"}},China:{0:{zh_cn:"船长，船能开到那里去吗？",en:"Captain, can the ship go there?",ru:"Капитан, может ли корабль отправиться туда?"},1:{zh_cn:"哦~不熟悉的地方。",en:"Oh ~ an unfamiliar place.",ru:"Ох ~ незнакомое место."}},Japan:{0:{zh_cn:"神奈川冲浪里，是在这里吧？",en:"The Great Wave off Kanagawa, right here?",ru:"Большая волна у Канагавы, прямо здесь?"},1:{zh_cn:"检测到海啸，船长。",en:"Tsunami detected, Captain.",ru:"Обнаружено цунами, Капитан."}},Korea:{0:{zh_cn:"那里的水散发着特殊的味道呢。",en:"The water there has a unique scent.",ru:"Вода там имеет особый запах."}},"United Kingdom":{0:{zh_cn:"被水包围起来了~",en:"Surrounded by water~",ru:"Окружен водой~"},1:{zh_cn:"想坐游轮了。",en:"I want to take a cruise.",ru:"Я хочу сесть на круизный корабль."}},France:{0:{zh_cn:"香水的味道~",en:"The scent of perfume~",ru:"Аромат парфюма~"},1:{zh_cn:"粉色的雨。",en:"Pink rain.",ru:"Розовый дождь."}},Australia:{0:{zh_cn:"动物们都喜欢清凉的水~",en:"",ru:""},1:{zh_cn:"沙漠里倒是没有水呢……",en:"Animals all like cold water~",ru:"Все животные любят холодную воду~"}},Canada:{0:{zh_cn:"仿佛深渊一般。",en:"Like an abyss.",ru:"Как пропасть."}},Venezuela:{0:{zh_cn:"之前没听说过这里。",en:"I haven't heard of this place before.",ru:"Я не слышал об этом месте раньше."}}},r={greeting:{0:{zh_cn:"请下达指令，船长。",en:"Please issue orders, Captain.",ru:"Пожалуйста, выдать указания, Капитан."},1:{zh_cn:"无论船长想要做什么，我都支持。",en:"I will support whatever Captain wants to do.",ru:"Я поддержу все, что Капитан хочет сделать."},2:{zh_cn:"我会努力当好一名秘书的！",en:"I will try my best to be a good secretary!",ru:"Я постараюсь быть хорошим секретарем!"},3:{zh_cn:"船长，我是不是您最喜欢的秘书？",en:"Am I your favorite secretary, Captain?",ru:"Я ваш любимый секретарь, Капитан?"},4:{zh_cn:"啾啾~啾啾~",en:"Chow~ chow~",ru:"Чоу~ чоу~"}},general:{0:{zh_cn:"我感觉好热。",en:"I feel hot.",ru:"Мне жарко."},1:{zh_cn:"和船长一同欣赏这种场面，感觉好开心~",en:"Enjoying this scene with Captain makes me feel so happy~",ru:"Наслаждаясь этой сценой с Капитаном, я чувствую себя такой счастливой~"},2:{zh_cn:"红色的天空……像不像玫瑰？",en:"The red sky...doesn't it look like a rose?",ru:"Красное небо... разве оно не похоже на розу?"},3:{zh_cn:"我对船长的热情，比眼前的火焰还要热烈。",en:"My passion for Captain, is more intense than the fire before eyes.",ru:"Моя страсть к Капитану сильнее, чем огонь в глазах."},4:{zh_cn:"船长，你能感受到我的心情吗？",en:"Captain, can you feel my mood?",ru:"Капитан, вы можете чувствовать мой настрой?"},5:{zh_cn:"船长，你可以把多余的精力浪费在我身上~",en:"Captain, you can waste your extra energy on me~",ru:"Капитан, вы можете потратить свою лишнюю энергию на меня~"},6:{zh_cn:"我们需要提高一下精准度了。",en:"We need to improve the accuracy.",ru:"Нам нужно повысить точность."}},Russia:{0:{zh_cn:"船长，你会送我那个地方的巧克力吗？",en:"Captain, will you bring me the chocolate from there?",ru:"Капитан, вы принесете мне шоколад оттуда?"},1:{zh_cn:"船长，我感觉好冷，可以……抱紧一点吗？",en:"Captain, I feel so cold, may you... hug me a little tighter?",ru:"Капитан, мне так холодно, не могли бы вы... обнять меня покрепче?"},2:{zh_cn:"船长，再给我讲讲那里的故事~",en:"Captain, tell me more stories about there~",ru:"Капитан, расскажите мне еще истории об этом~"}},Ukraine:{0:{zh_cn:"听说那里的兔兔很可爱。",en:"I heard the bunnies there are very cute.",ru:"Я слышал, что кролики там очень милые."}},"United States":{0:{zh_cn:"船长，这个地方……对我来说好遥远。",en:"Captain, this place... seems so far away for me.",ru:"Капитан, это место... кажется мне таким далеким."},1:{zh_cn:"老鹰会抓走兔兔的。",en:"The eagle will catch bunnies.",ru:"Орел будет ловить зайцев."}},China:{0:{zh_cn:"船长，兔兔在那里会被做成菜的，对吧？",en:"Captain, bunnies will be cooked there, right?",ru:"Капитан, там кроликов будут готовить, да?"},1:{zh_cn:"不知道新买的玩具什么时候到呢。",en:"I don't know when the new toys I bought will arrive.",ru:"Я не знаю, когда прибудут новые игрушки, которые я купил."}},Japan:{0:{zh_cn:"我稍微有点饿了，船长，要不要试试我做的甜点？",en:"I'm a little hungry. Captain, would you like to try the dessert I made?",ru:"Я немного голоден. Капитан, хотите попробовать десерт, который я приготовил?"},1:{zh_cn:"太阳有点刺眼~",en:"The sun is a bit dazzling~",ru:"Солнце немного ослепляет~"}},Korea:{0:{zh_cn:"兔兔们的穿着都好花哨啊。",en:"The bunnies are dressed so fancy.",ru:"Кролики одеты так нарядно."}},"United Kingdom":{0:{zh_cn:"兔兔也会下蛋吗？",en:"Can bunnies also lay eggs?",ru:"Кролики тоже откладывают яйца?"},1:{zh_cn:"我不太喜欢阴天，船长~",en:"I don't like cloudy days, Captain~",ru:"Я не люблю пасмурные дни, Капитан~"}},France:{0:{zh_cn:"兔兔也想尝尝红酒。",en:"I also want to taste red wine.",ru:"Еще я хочу попробовать красное вино."},1:{zh_cn:"挥舞着旗帜~",en:"Wave the flag~",ru:"Помашите флагом~"}},Australia:{0:{zh_cn:"尽情地奔跑！",en:"Run freely!",ru:"Беги на полную!"},1:{zh_cn:"把船长的爱，装进口袋里~",en:"Put the love from Captain into pocket~",ru:"Положи любовь от Капитана в карман~"}},Canada:{0:{zh_cn:"什么都看不见了~",en:"Can't see anything anymore~",ru:"Ничего не видно больше~"}},Venezuela:{0:{zh_cn:"可怜。",en:"Pity.",ru:"Печаль."}}},i={neco_arc:e,meowscarada:n,vaporeon:a,lopunny:r},t={zh_cn:"终止",en:"CANCEL",ru:"ОТМЕНА"},h={zh_cn:"发射",en:"LAUNCH",ru:"ЗАПУСК"},c={zh_cn:"已选区域",en:"SELECTED",ru:"ВЫБРАН"},o={launch_cancel:t,launch_confirm:h,selected_region:c};export{i as d,o as u};
